import React, { useState } from 'react';
import { Container, Row, Col, Form, Button } from 'react-bootstrap';
import '../styles/Newsletter.css';

const NinjaBirdSVG = () => (
  <div className="ninja-bird-visual" style={{ marginBottom: '1.5rem' }}>
    <svg width="90" height="70" viewBox="0 0 90 70" fill="none" xmlns="http://www.w3.org/2000/svg">
      {/* Ninja bird body */}
      <ellipse cx="45" cy="40" rx="22" ry="18" fill="#222" stroke="#b6f7b0" strokeWidth="2"/>
      {/* Bird head */}
      <ellipse cx="60" cy="28" rx="10" ry="10" fill="#222" stroke="#b6f7b0" strokeWidth="2"/>
      {/* Ninja band */}
      <rect x="52" y="24" width="16" height="6" rx="3" fill="#ff4d4d"/>
      {/* Eye */}
      <ellipse cx="64" cy="28" rx="2.2" ry="2.2" fill="#fff"/>
      <ellipse cx="66" cy="28" rx="0.7" ry="0.7" fill="#222"/>
      {/* Beak */}
      <polygon points="70,30 75,32 70,34" fill="#ffd700"/>
      {/* Wings */}
      <path d="M30 45 Q15 55 35 60" stroke="#222" strokeWidth="4" fill="none"/>
      <path d="M60 50 Q80 60 55 65" stroke="#222" strokeWidth="4" fill="none"/>
      {/* Scroll (email) */}
      <rect x="10" y="10" width="22" height="10" rx="4" fill="#fff" stroke="#0077b5" strokeWidth="2"/>
      <rect x="28" y="10" width="4" height="10" rx="2" fill="#b6f7b0"/>
      <rect x="10" y="10" width="4" height="10" rx="2" fill="#b6f7b0"/>
      <rect x="16" y="14" width="10" height="2.5" rx="1.2" fill="#0077b5"/>
      {/* Dotted line (delivery path) */}
      <path d="M32 15 Q50 20 60 28" stroke="#0077b5" strokeDasharray="3 3" strokeWidth="2" fill="none"/>
    </svg>
  </div>
);

const Newsletter = () => {
  const [email, setEmail] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: Implement newsletter signup logic
    console.log('Newsletter signup:', email);
  };

  return (
    <section className="newsletter-section">
      <Container>
        <Row className="justify-content-center text-center">
          <Col lg={8}>
            <NinjaBirdSVG />
            <h2 className="section-title">Join the Ninja Network</h2>
            <p className="newsletter-description">
              Get stealthy strategies and social tips straight to your inbox.
            </p>
            <Form onSubmit={handleSubmit} className="newsletter-form-flex">
              <Form.Control
                type="email"
                placeholder="Enter your email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
                className="newsletter-input"
              />
              <Button type="submit" className="subscribe-button">
                Subscribe
              </Button>
            </Form>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Newsletter;
